  false,\n\t\"url\": null,\n\t\"notes\": \"This is an ESRI shapefile of National Park
  Service tract data. Tracts are numbered and created by the regional cartographic
  staff at the Land Resources Program Centers and are associated to the Lands Status
  Maps. This theme should be used to display properties that NPS owns and properties
  that NPS may have some type of interest, e.g.- scenic easements. * On May 9, 2006,
  fields for were added to account for property ownership according to Arizona Bureau
  of Land Mgmt. GIS records. * On July 19, 2006 an Identity process was performed
  to break sections out of private lands. The source data for this process was PLSS
  data from LSIS. Once sections were broken out, a hardcopy map representing private
  ownership was used to identify 'who owns what' regarding private lands in the PEFO
  region.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
